import React, { useState, useEffect } from 'react';
import axios from 'axios';
import AuthBanner from './components/AuthBanner';
import FileUploader from './components/FileUploader';
import FileList from './components/FileList';
import ErrorMessage from './components/ErrorMessage';

const BASE_URL = 'http://localhost:8080';

function App() {
  const [user, setUser] = useState(null);
  const [files, setFiles] = useState([]);
  const [selectedFile, setSelectedFile] = useState(null);
  const [error, setError] = useState('');
  const [loading, setLoading] = useState(false);
  const [nextPageToken, setNextPageToken] = useState(null);

  const fetchUser = async () => {
    try {
      const response = await axios.get(`${BASE_URL}/auth/user`, { withCredentials: true });
      setUser(response.data);
    } catch (err) {
      console.error('Error fetching user:', err);
    }
  };

  const fetchFiles = async (pageToken = null) => {
    try {
      setLoading(true);
      const params = pageToken ? `?pageToken=${pageToken}` : '';
      const response = await axios.get(`${BASE_URL}/drive/files${params}`, { withCredentials: true });
      const data = typeof response.data === 'string' ? JSON.parse(response.data) : response.data;
      setFiles(data.files || []);
      setNextPageToken(data.nextPageToken || null);
      setError('');
    } catch (err) {
      console.error('Error fetching files:', err);
      setError('Error fetching files.');
    } finally {
      setLoading(false);
    }
  };

  const handleFileUpload = async (e) => {
    e.preventDefault();
    if (!selectedFile) return;

    const formData = new FormData();
    formData.append('file', selectedFile);

    try {
      await axios.post(`${BASE_URL}/drive/upload`, formData, {
        withCredentials: true,
        headers: { 'Content-Type': 'multipart/form-data' },
      });
      setError('');
      setSelectedFile(null);
      fetchFiles();
    } catch (err) {
      console.error('Error uploading file:', err);
      setError('Error uploading file');
    }
  };

  const handleDelete = async (fileId) => {
    try {
      await axios.delete(`${BASE_URL}/drive/files/${fileId}`, { withCredentials: true });
      setError('');
      fetchFiles();
    } catch (err) {
      console.error('Error deleting file:', err);
      setError('Error deleting file');
    }
  };

  const handleDownload = async (fileId) => {
    try {
      const response = await axios.get(`${BASE_URL}/drive/files/download/${fileId}`, {
        withCredentials: true,
        responseType: 'blob',
      });

      const blob = new Blob([response.data], { type: response.headers['content-type'] });

      let filename = 'downloadedFile';
      const disposition = response.headers['content-disposition'];
      if (disposition && disposition.indexOf('filename=') !== -1) {
        const matches = /filename[^;=\n]*=((['"]).*?\2|[^;\n]*)/.exec(disposition);
        if (matches != null && matches[1]) {
          filename = matches[1].replace(/['"]/g, '');
        }
      }

      const url = window.URL.createObjectURL(blob);
      const link = document.createElement('a');
      link.href = url;
      link.setAttribute('download', filename);
      document.body.appendChild(link);
      link.click();
      document.body.removeChild(link);
      window.URL.revokeObjectURL(url);
      setError('');
    } catch (err) {
      console.error('Error downloading file:', err);
      setError('Error downloading file');
    }
  };

  useEffect(() => { fetchUser(); }, []);
  useEffect(() => { if (user) fetchFiles(); }, [user]);

  return (
    <div style={{ margin: '20px' }}>
      <h1>DriveSync App</h1>

      {user ? (
        <>
          <AuthBanner user={user} />
          <button onClick={() => fetchFiles()}>Refresh Files</button>
          <ErrorMessage error={error} />
          {loading ? <p>Loading files...</p> : (
            <>
              <FileList files={files} onDelete={handleDelete} onDownload={handleDownload} />
              {nextPageToken && (
                <button onClick={() => fetchFiles(nextPageToken)}>Next Page</button>
              )}
            </>
          )}
          <h2>Upload a File</h2>
          <FileUploader onUpload={handleFileUpload} selectedFile={selectedFile} setSelectedFile={setSelectedFile} />
        </>
      ) : (
        <div>
          <p>You are not logged in.</p>
          <a href={`${BASE_URL}/oauth2/authorization/google`}>
            <button>Login with Google</button>
          </a>
        </div>
      )}
    </div>
  );
}

export default App;
